import { ADD_TO_ORDERER } from '../actions'
 
const initialState = {
    list: []
}
 
export function addToOrderer(state = initialState, action) {
    
    switch (action.type) {
        case ADD_TO_ORDERER:
            return state.push(action.payload)
        default:
            return state 
    }
    
}
